import React from "react"

const Admin = () => {
    return (
        <div>
            <h1>Admin</h1>
            <form>
                <label htmlFor="email"> Email ID </label>
                <input type='email' id='email'/>
                <br/>
                <label htmlFor="number"> Room No </label>
                <input type='text' id='number'/>
            </form>
        </div>
    )
}
export default Admin;
